      <TextField required
        helperText=" "
        id="demo-helper-text-aligned-no-helper"
        name='message'
        type="text"
        label="Message"
      /></FormControl>
      <Button variant="primary" type="submit" value="Send">
        Submit
      </Button>
    </form>
  )
}

export default Contact
